        public static List<long> ElfMix(List<long> elfFile, int times = 1, long? decriptionKey = null, int verbose = 0)
        {
            if (verbose > 0)
            {
                Console.WriteLine($"Initial arrangement:");
                Utils.PrintList(elfFile);
            }

            if (decriptionKey != null)
            {
                for (int i = 0; i < elfFile.Count; i++)
                {
                    elfFile[i] *= decriptionKey.Value;
                }
                if (verbose > 0)
                {
                    Console.WriteLine($"After applying decription key:");
                    Utils.PrintList(elfFile);
                }
            }

            //Companion list that stores the original order of numbers. Swaps should be done to this one too.
            //For each swap, we use this as reference and call indexOf() to see where each index inow is.
            //e.g. if we want to know where is the number that originally was at index 2, we indexOf(2) and see the new position
            List<int> elfPositions = Enumerable.Range(0, elfFile.Count).ToList();

            for (int pass = 1; pass <= times; pass++)
            {
                for (int i = 0; i < elfFile.Count; i++)
                {
                    int currIndex = elfPositions.IndexOf(i);
                    long currNumber = elfFile[currIndex];
                    if (currNumber == 0)
                    {
                        continue;
                    }
                    int maxIndex = elfFile.Count - 1;

                    long desiredIndex = currIndex + currNumber;

                    desiredIndex %= maxIndex;
                    //HEY DID YOU KNOW C# % IS NOT ACTUALLY MODULO LIKE IN JUST ABOUT EVERYWHERE ELSE
                    //BUT RATHER REMAINDER SO IT WORKS DIFFERENTLY FOR NEGATIVE NUMBERS
                    //SUPER FUN!
                    if (desiredIndex <= 0)
                    {
                        desiredIndex += maxIndex;
                    }

                    int finalIndex = (int)desiredIndex;

                    if (verbose > 1) Console.WriteLine($"{currNumber} moves from index {currIndex} to {finalIndex}, between {elfFile[finalIndex]} and {elfFile[finalIndex + 1 > maxIndex ? 0 : finalIndex + 1]}:");
                    DoTheSwap(elfFile, currIndex, finalIndex);
                    DoTheSwap(elfPositions, currIndex, finalIndex); //Also swap the companion list!

                    if (verbose > 1)
                    {
                        Utils.PrintList(elfFile);
                        Utils.PrintList(elfPositions);
                        Console.WriteLine($"");
                    }
                }

                if (verbose > 0)
                {
                    Console.WriteLine($"After {pass} rounds of mixing:");
                    Utils.PrintList(elfFile);
                }
            }
            return elfFile;
        }

        public static void PrintGroveCoords(List<long> elfFile)
        {
            int indexOfZero = elfFile.IndexOf(0);
            long sum = 0;
            Console.WriteLine($"Index of 0 is {indexOfZero}! Elf file has {elfFile.Count} entries, last index is {elfFile.Count - 1}.");
            for (int i = 1; i < 4; i++)
            {
                int newIndex = indexOfZero + (i * 1000);
                int indexWrappedAround = newIndex % (elfFile.Count);
                long importantNumber = elfFile[indexWrappedAround];
                Console.WriteLine($"Number #{i} is {importantNumber} at index {indexWrappedAround}");
                sum += importantNumber;
            }
            Console.WriteLine($"Final sum of the three numbers that form the grove coordinates: {sum}.");
        }

        public static void DoTheSwap<T>(List<T> theList, int indexFrom, int indexTo)
        {
            var valueBeingSwapped = theList[indexFrom];
            theList.RemoveAt(indexFrom);
            theList.Insert(indexTo, valueBeingSwapped);
        }

